			</p>
		</form>
	);
};

// Export
export default MyPost;

// Styling with CSS-in-JS
const styles = {
	myPost: {
		padding: '15px',
		backgroundColor: 'lightGrey',
		color: 'black',
	},
	iconsContainer: {
		display: 'flex',
		justifyContent: 'space-between',
	},
	rightIcons: {
		color: 'black',
		backgroundColor: 'inherit',
		border: 'none',
		fontSize: '2rem',
		cursor: 'pointer',
	},
};
